import BootstrapTable from 'react-bootstrap-table-next';
import { Spinner } from "react-bootstrap";
import React from 'react';


function add_column(columns, dataField, text, sort){
  columns.push({
    dataField: dataField,
    text: text,
    sort: sort
  })
}

function Table({data, columnTitles}) {
  if(!data || data.length === 0) return <Spinner animation="border" variant="primary" size="mg"/>;
  console.log("tableData", data);
  let columns = [];
  columnTitles.forEach(element => add_column(columns, element, element, true));

  return <BootstrapTable data={ data }
                         columns={ columns }
                         striped
                         hover
                         condensed/>
}




export default Table;
